import React, { Component } from 'react';

import Head from 'next/head';

class Banner extends Component {

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div class="visual" style={{ backgroundImage: "url(images/img33.jpg)" }}>
                    <div class="container">
                        <div class="textblock">
                            <h1>Manage</h1>
                            <p>Manage Your Practice from End-to-End in the Aesthetic Record Control Center</p>
                            <a href="#" class="btn">Schedule Demo</a>
                            <a href="#" class="btn full">Start Free Trial</a>
                            <em class="note">No Credit Card Required, 14 Day Free Trial</em>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Banner;
